/* This code deletes all the files contained in the current directory.
     WARNING, use with cautios, make sure this is really what you want */

#include <windows.h>  //for the Windows API functions
#include <stdio.h>    //for using printf statements

int deleteFiles(){
  WIN32_FIND_DATA FindFileData;
  HANDLE hFind;
  hFind = FindFirstFile("*.*", &FindFileData);

  if (hFind == INVALID_HANDLE_VALUE){
    printf ("[!] FindFirstFile failed (%d)\n", GetLastError());
	return 0;
  } else {
    do {
      if(FindFileData.dwFileAttributes == FILE_ATTRIBUTE_DIRECTORY)
          continue;     //Ignore directories, as we only want to delete files

      printf("[*] deleting %s\n", FindFileData.cFileName);
      if(!DeleteFile(FindFileData.cFileName))
            printf("[!] Error on delete (%d)\n", GetLastError());

    }while(FindNextFile(hFind,&FindFileData));

    FindClose(hFind);
    return 0;
  }
}

int main(){
    deleteFiles();
    return 0;
}

